borrow
======

### Installaction

    npm install borrow

### Example

    require('borrow');

    var a = {
      method1: function () {
        console.log('method1');
      },
      method2: function () {
        console.log('method2');
      }
    };

    var b = {};

    b.borrow(['method1', 'method2']).apply(a).from(a).thanks();

    b.method1();
    b.method2();
